#include <stdio.h>
#include <stdlib.h>
#include <assert.h>
#include <string.h>
#include "q7.h"

void test_hex_product();

int main(){
    test_hex_product();
    return 0;
}

void test_hex_product(){
    printf("%s", "test_hex_product ... ");

    char* pr1 = hex_product('F', "FFFF");
    assert(strcmp(pr1, "EFFF1") == 0);
    free(pr1);

    char* pr2 = hex_product('F', "");
    assert(strcmp(pr2, "") == 0);
    free(pr2);

    char* pr3 = hex_product('5', "");
    assert(strcmp(pr3, "") == 0);
    free(pr3);

    char* pr4 = hex_product('A', "");
    assert(strcmp(pr4, "") == 0);
    free(pr4);

    char* pr5 = hex_product('A', "");
    assert(strcmp(pr5, "") == 0);
    free(pr5);

    char* pr6 = hex_product('0', "");
    assert(strcmp(pr6, "0") == 0);
    free(pr6);

    char* pr7 = hex_product('1', "");
    assert(strcmp(pr7, "") == 0);
    free(pr7);

    char* pr8 = hex_product('9', "");
    assert(strcmp(pr8, "") == 0);
    free(pr8);

    printf("%s", "OK\n");
    return;
}


